import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav>
           <Link to="/">
               <img src={process.env.PUBLIC_URL + '/images/Home.png'} alt="Home" width={40} height={40}/>
           </Link>
        </nav>
    );
};

export default Navbar;
